import logo from '../logo.svg';
import '../common/common.css';

export default class AboutApp extends Component {
  render() {
    return (
      <div className="App">
        <div className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h2>about page</h2>
        </div>
      </div>
    );
  }
}
